(149, 1, '2022-11-18 01:53:37', '2022-11-18 01:53:37', '<!-- wp:paragraph -->\n<p>Resumen :</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sociedad de Inversiones Pampa Calichera S.A. es una empresa que se dedica a las inversiones, principalmente en el sector de la minería y la industria química.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":134,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/circum/wp-content/uploads/2022/11/calichera_01-1024x443.jpg\" alt=\"\" class=\"wp-image-134\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":139,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/circum/wp-content/uploads/2022/11/calichera_04-1024x463.jpg\" alt=\"\" class=\"wp-image-139\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Durante el perido 2018 - 2022-11-17 se hanentregado 14 dividendos promediando 2.8 dividendos por año</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":140,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/circum/wp-content/uploads/2022/11/calichera_05-1024x466.jpg\" alt=\"\" class=\"wp-image-140\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Aun con un valle bastante extenso calichera continuo con la entrega de dividendos consistentemente </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":147,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/circum/wp-content/uploads/2022/11/calichera_08-1024x395.jpg\" alt=\"\" class=\"wp-image-147\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":135,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/circum/wp-content/uploads/2022/11/calichera_02-1024x442.jpg\" alt=\"\" class=\"wp-image-135\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Durante el periodo 2018-10-07 a 2021-06-13 se experimiento una tendencia bajista de -6250% debido a la baja de demanda por pandemia c-19 </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":138,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/circum/wp-content/uploads/2022/11/calichera_03-1024x443.jpg\" alt=\"\" class=\"wp-image-138\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Durante el periodo 2021-06-13 a 2021-11-13 se experimento una recuperacion del 199.87% con respecto al indice de fecha inicial</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":143,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/circum/wp-content/uploads/2022/11/calichera_06-1024x435.jpg\" alt=\"\" class=\"wp-image-143\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":145,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/circum/wp-content/uploads/2022/11/calichera_07-1024x446.jpg\" alt=\"\" class=\"wp-image-145\"/></figure>\n<!-- /wp:image -->', 'Reporte PAMPA CALICHERA S.A Movimientos 2018-01-01 a 2022-11-17', '', 'inherit', 'closed', 'closed', '', '132-revision-v1', '', '', '2022-11-18 01:53:37', '2022-11-18 01:53:37', '', 132, 'http://localhost/circum/?p=149', 0, 'revision', '', 0);
